(1, 'Python programming', '<p><strong>Python</strong>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Measuring_programming_language_popularity">widely used</a>&nbsp;<a href="https://en.wikipedia.org/wiki/High-level_programming_language">high-level programming language</a>&nbsp;for&nbsp;<a href="https://en.wikipedia.org/wiki/General-purpose_programming_language">general-purpose programming</a>, created by&nbsp;<a href="https://en.wikipedia.org/wiki/Guido_van_Rossum">Guido van Rossum</a>&nbsp;and first released in 1991. An&nbsp;<a href="https://en.wikipedia.org/wiki/Interpreted_language">interpreted language</a>, Python has a design philosophy which emphasizes code&nbsp;<a href="https://en.wikipedia.org/wiki/Readability">readability</a>&nbsp;(notably using&nbsp;<a href="https://en.wikipedia.org/wiki/Whitespace_character">whitespace</a>&nbsp;indentation to delimit&nbsp;<a href="https://en.wikipedia.org/wiki/Code_block">code blocks</a>&nbsp;rather than curly brackets or keywords), and a syntax which allows programmers to express concepts in fewer&nbsp;<a href="https://en.wikipedia.org/wiki/Source_lines_of_code">lines of code</a>&nbsp;than possible in languages such as&nbsp;<a href="https://en.wikipedia.org/wiki/C%2B%2B">C++</a>&nbsp;or&nbsp;<a href="https://en.wikipedia.org/wiki/Java_(programming_language)">Java</a>.<a href="https://en.wikipedia.org/wiki/Python_(programming_language)#cite_note-Summerfield-22">[22]</a><a href="https://en.wikipedia.org/wiki/Python_(programming_language)#cite_note-23">[23]</a>&nbsp;The language provides constructs intended to enable writing clear programs on both a small and large scale.<a href="https://en.wikipedia.org/wiki/Python_(programming_language)#cite_note-AutoNT-7-24">[24]</a></p>\r\n\r\n<p>Python features a&nbsp;<a href="https://en.wikipedia.org/wiki/Dynamic_type">dynamic type</a>&nbsp;system and automatic&nbsp;<a href="https://en.wikipedia.org/wiki/Memory_management">memory management</a>&nbsp;and supports multiple&nbsp;<a href="https://en.wikipedia.org/wiki/Programming_paradigm">programming paradigms</a>, including&nbsp;<a href="https://en.wikipedia.org/wiki/Object-oriented_programming">object-oriented</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Imperative_programming">imperative</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Functional_programming">functional programming</a>, and&nbsp;<a href="https://en.wikipedia.org/wiki/Procedural_programming">procedural</a>&nbsp;styles. It has a large and comprehensive&nbsp;<a href="https://en.wikipedia.org/wiki/Standard_library">standard library</a>.<a href="https://en.wikipedia.org/wiki/Python_(programming_language)#cite_note-About-25">[25]</a></p>\r\n\r\n<p>Python interpreters are available for many&nbsp;<a href="https://en.wikipedia.org/wiki/Operating_system">operating systems</a>, allowing Python code to run on a wide variety of systems.&nbsp;<a href="https://en.wikipedia.org/wiki/CPython">CPython</a>, the&nbsp;<a href="https://en.wikipedia.org/wiki/Reference_implementation">reference implementation</a>&nbsp;of Python, is&nbsp;<a href="https://en.wikipedia.org/wiki/Open_source">open source</a>&nbsp;software<a href="https://en.wikipedia.org/wiki/Python_(programming_language)#cite_note-26">[26]</a>&nbsp;and has a community-based development model, as do nearly all of its variant implementations. CPython is managed by the non-profit&nbsp;<a href="https://en.wikipedia.org/wiki/Python_Software_Foundation">Python Software Foundation</a>.</p>', '2017-06-05 18:47:09', '2017-06-07 13:53:24', 5, 'python-logo_1496850804.jpeg'),
(2, 'Atom text editor', '<p><strong>Atom</strong>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Free_and_open-source_software">free and open-source</a><a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-lifehacker-4">[4]</a><a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-TechCrunch-5">[5]</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Text_editor">text</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Source_code_editor">source code editor</a>&nbsp;for&nbsp;<a href="https://en.wikipedia.org/wiki/MacOS">macOS</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Linux">Linux</a>, and&nbsp;<a href="https://en.wikipedia.org/wiki/Microsoft_Windows">Microsoft Windows</a><a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-6">[6]</a>&nbsp;with support for&nbsp;<a href="https://en.wikipedia.org/wiki/Plug-in_(computing)">plug-ins</a>&nbsp;written in&nbsp;<a href="https://en.wikipedia.org/wiki/Node.js">Node.js</a>, and embedded&nbsp;<a href="https://en.wikipedia.org/wiki/Git">Git Control</a>, developed by&nbsp;<a href="https://en.wikipedia.org/wiki/GitHub">GitHub</a>. Atom is a desktop application built using web technologies.<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-7">[7]</a>&nbsp;Most of the extending packages have&nbsp;<a href="https://en.wikipedia.org/wiki/Free_software_license">free software licenses</a>&nbsp;and are community-built and maintained.<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-8">[8]</a>&nbsp;Atom is based on&nbsp;<a href="https://en.wikipedia.org/wiki/Electron_(software_framework)">Electron</a>&nbsp;(formerly known as Atom Shell),<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-9">[9]</a>&nbsp;a framework that enables cross-platform desktop applications using&nbsp;<a href="https://en.wikipedia.org/wiki/Chromium_(web_browser)">Chromium</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Node.js">Node.js</a>.<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-10">[10]</a><a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-11">[11]</a>&nbsp;It is written in&nbsp;<a href="https://en.wikipedia.org/wiki/CoffeeScript">CoffeeScript</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Less_(stylesheet_language)">Less</a>.<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-12">[12]</a>&nbsp;It can also be used as an&nbsp;<a href="https://en.wikipedia.org/wiki/Integrated_development_environment">integrated development environment</a>&nbsp;(IDE).<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-nuclide-13">[13]</a><a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-juno-14">[14]</a><a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-platformio-15">[15]</a>&nbsp;Atom was released from beta, as version 1.0, on June 25, 2015.<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-16">[16]</a>&nbsp;Its developers call it a &quot;hackable text editor for the 21st Century&quot;.<a href="https://en.wikipedia.org/wiki/Atom_(text_editor)#cite_note-17">[17]</a></p>', '2017-06-05 18:47:09', '2017-06-07 13:55:57', 5, 'atom-editor_1496850957.jpg'),
(3, 'CISCO', '<p><strong>Cisco Systems, Inc.</strong>&nbsp;(known as&nbsp;<strong>Cisco</strong>) is an American&nbsp;<a href="https://en.wikipedia.org/wiki/Multinational_corporation">multinational</a>&nbsp;technology&nbsp;<a href="https://en.wikipedia.org/wiki/Conglomerate_(company)">conglomerate</a>&nbsp;headquartered in&nbsp;<a href="https://en.wikipedia.org/wiki/San_Jos%C3%A9,_California">San Jos&eacute;, California</a>, in the center of&nbsp;<a href="https://en.wikipedia.org/wiki/Silicon_Valley">Silicon Valley</a>, that develops, manufactures, and sells&nbsp;<a href="https://en.wikipedia.org/wiki/Networking_hardware">networking hardware</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Telecommunications_equipment">telecommunications equipment</a>, and other&nbsp;<a href="https://en.wikipedia.org/wiki/High-technology">high-technology</a>&nbsp;services and products.<a href="https://en.wikipedia.org/wiki/Cisco_Systems#cite_note-Cisco-Sep-2012-10-K-4">[4]</a>&nbsp;Through its numerous acquired subsidiaries, such as&nbsp;<a href="https://en.wikipedia.org/wiki/OpenDNS">OpenDNS</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/WebEx">WebEx</a>, and&nbsp;<a href="https://en.wikipedia.org/wiki/Cisco_Jasper">Jasper</a>, Cisco specializes into specific tech markets, such as&nbsp;<a href="https://en.wikipedia.org/wiki/Internet_of_Things">Internet of Things</a>&nbsp;(IoT),&nbsp;<a href="https://en.wikipedia.org/wiki/Internet_domain">domain security</a>, and&nbsp;<a href="https://en.wikipedia.org/wiki/Energy_management">energy management</a>.</p>\r\n\r\n<p>Cisco is the largest networking company in the world. The stock was added to the&nbsp;<a href="https://en.wikipedia.org/wiki/Dow_Jones_Industrial_Average">Dow Jones Industrial Average</a>&nbsp;on June 8, 2009, and is also included in the&nbsp;<a href="https://en.wikipedia.org/wiki/S%26P_500">S&amp;P 500</a>&nbsp;Index, the&nbsp;<a href="https://en.wikipedia.org/wiki/Russell_1000_Index">Russell 1000 Index</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/NASDAQ-100">NASDAQ-100</a>&nbsp;Index and the Russell 1000 Growth Stock Index.<a href="https://en.wikipedia.org/wiki/Cisco_Systems#cite_note-5">[5]</a></p>\r\n\r\n<p>Cisco Systems was founded in December 1984 by&nbsp;<a href="https://en.wikipedia.org/wiki/Leonard_Bosack">Leonard Bosack</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Sandy_Lerner">Sandy Lerner</a>, two&nbsp;<a href="https://en.wikipedia.org/wiki/Stanford_University">Stanford University</a>&nbsp;computer scientists, who pioneered the concept of a&nbsp;<a href="https://en.wikipedia.org/wiki/Local_area_network">local area network (LAN)</a>&nbsp;being used to connect geographically disparate computers over a multiprotocol&nbsp;<a href="https://en.wikipedia.org/wiki/Router_(computing)">router system</a>. By the time the company went public in 1990, when it was listed on the&nbsp;<a href="https://en.wikipedia.org/wiki/NASDAQ">NASDAQ</a>, Cisco had a market capitalization of $224 million. Cisco was the most valuable company in the world by 2000, with a more than $500 billion market capitalization.<a href="https://en.wikipedia.org/wiki/Cisco_Systems#cite_note-auto-6">[6]</a></p>', '2017-06-05 18:47:09', '2017-06-07 13:57:56', 5, 'cisco_logo_1496851076.jpg'),
(4, 'Amazon Web Service', '<p><strong>Cisco Systems, Inc.</strong>&nbsp;(known as&nbsp;<strong>Cisco</strong>) is an American&nbsp;<a href="https://en.wikipedia.org/wiki/Multinational_corporation">multinational</a>&nbsp;technology&nbsp;<a href="https://en.wikipedia.org/wiki/Conglomerate_(company)">conglomerate</a>&nbsp;headquartered in&nbsp;<a href="https://en.wikipedia.org/wiki/San_Jos%C3%A9,_California">San Jos&eacute;, California</a>, in the center of&nbsp;<a href="https://en.wikipedia.org/wiki/Silicon_Valley">Silicon Valley</a>, that develops, manufactures, and sells&nbsp;<a href="https://en.wikipedia.org/wiki/Networking_hardware">networking hardware</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Telecommunications_equipment">telecommunications equipment</a>, and other&nbsp;<a href="https://en.wikipedia.org/wiki/High-technology">high-technology</a>&nbsp;services and products.<a href="https://en.wikipedia.org/wiki/Cisco_Systems#cite_note-Cisco-Sep-2012-10-K-4">[4]</a>&nbsp;Through its numerous acquired subsidiaries, such as&nbsp;<a href="https://en.wikipedia.org/wiki/OpenDNS">OpenDNS</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/WebEx">WebEx</a>, and&nbsp;<a href="https://en.wikipedia.org/wiki/Cisco_Jasper">Jasper</a>, Cisco specializes into specific tech markets, such as&nbsp;<a href="https://en.wikipedia.org/wiki/Internet_of_Things">Internet of Things</a>&nbsp;(IoT),&nbsp;<a href="https://en.wikipedia.org/wiki/Internet_domain">domain security</a>, and&nbsp;<a href="https://en.wikipedia.org/wiki/Energy_management">energy management</a>.</p>\r\n\r\n<p>Cisco is the largest networking company in the world. The stock was added to the&nbsp;<a href="https://en.wikipedia.org/wiki/Dow_Jones_Industrial_Average">Dow Jones Industrial Average</a>&nbsp;on June 8, 2009, and is also included in the&nbsp;<a href="https://en.wikipedia.org/wiki/S%26P_500">S&amp;P 500</a>&nbsp;Index, the&nbsp;<a href="https://en.wikipedia.org/wiki/Russell_1000_Index">Russell 1000 Index</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/NASDAQ-100">NASDAQ-100</a>&nbsp;Index and the Russell 1000 Growth Stock Index.<a href="https://en.wikipedia.org/wiki/Cisco_Systems#cite_note-5">[5]</a></p>\r\n\r\n<p>Cisco Systems was founded in December 1984 by&nbsp;<a href="https://en.wikipedia.org/wiki/Leonard_Bosack">Leonard Bosack</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Sandy_Lerner">Sandy Lerner</a>, two&nbsp;<a href="https://en.wikipedia.org/wiki/Stanford_University">Stanford University</a>&nbsp;computer scientists, who pioneered the concept of a&nbsp;<a href="https://en.wikipedia.org/wiki/Local_area_network">local area network (LAN)</a>&nbsp;being used to connect geographically disparate computers over a multiprotocol&nbsp;<a href="https://en.wikipedia.org/wiki/Router_(computing)">router system</a>. By the time the company went public in 1990, when it was listed on the&nbsp;<a href="https://en.wikipedia.org/wiki/NASDAQ">NASDAQ</a>, Cisco had a market capitalization of $224 million. Cisco was the most valuable company in the world by 2000, with a more than $500 billion market capitalization.<a href="https://en.wikipedia.org/wiki/Cisco_Systems#cite_note-auto-6">[6]</a></p>', '2017-06-05 18:47:09', '2017-06-07 14:00:51', 1, 'amazon_1496851251.jpg'),
(7, 'Ethereum', '<p><strong>Ethereum</strong>&nbsp;is an&nbsp;<a href="https://en.wikipedia.org/wiki/Open-source">open-source</a>, public,&nbsp;<a href="https://en.wikipedia.org/wiki/Blockchain_(database)">blockchain</a>-based&nbsp;<a href="https://en.wikipedia.org/wiki/Distributed_computing">distributed computing</a>&nbsp;platform featuring&nbsp;<a href="https://en.wikipedia.org/wiki/Smart_contract">smart contract</a>&nbsp;(scripting) functionality, which facilitates online contractual agreements.<a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-CDUE-2">[2]</a>&nbsp;It provides a decentralized&nbsp;<a href="https://en.wikipedia.org/wiki/Turing_completeness">Turing-complete</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Virtual_machine">virtual machine</a>, the Ethereum Virtual Machine (EVM), which can execute scripts using an international network of public nodes. Ethereum also provides a&nbsp;<a href="https://en.wikipedia.org/wiki/Cryptocurrency">cryptocurrency</a>&nbsp;token called &quot;ether&quot;, which can be transferred between accounts and used to compensate participant nodes for computations performed. Gas, an internal transaction pricing mechanism, is used to prevent&nbsp;<a href="https://en.wikipedia.org/wiki/Spamming">spam</a>&nbsp;and allocate resources on the network.<a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-CDUE-2">[2]</a><a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-3">[3]</a></p>\r\n\r\n<p>Ethereum was proposed in late 2013 by&nbsp;<a href="https://en.wikipedia.org/wiki/Vitalik_Buterin">Vitalik Buterin</a>, a&nbsp;<a href="https://en.wikipedia.org/wiki/Cryptocurrency">cryptocurrency</a>&nbsp;researcher and programmer. Development was funded by an online&nbsp;<a href="https://en.wikipedia.org/wiki/Crowdfunding">crowdsale</a>&nbsp;during July&ndash;August 2014.<a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-forbes20160423-4">[4]</a>&nbsp;The system went live on 30 July 2015, with 11.9 million coins &quot;premined&quot; for the crowdsale.<a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-5">[5]</a>&nbsp;This accounts for approximately 13 percent of the total circulating supply.[<em><a href="https://en.wikipedia.org/wiki/Wikipedia:Manual_of_Style/Dates_and_numbers#Chronological_items">when?</a></em>]</p>\r\n\r\n<p>In 2016 Ethereum was forked into two blockchains, as a result of the collapse of&nbsp;<a href="https://en.wikipedia.org/wiki/The_DAO_(organization)">The DAO</a>&nbsp;project. The two chains have different numbers of users, and the minority fork was renamed to&nbsp;<a href="https://en.wikipedia.org/wiki/Ethereum_Classic">Ethereum Classic</a><a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-BMETCP-6">[6]</a>. The majority fork has retained the name Ethereum (the subject of this article).<a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-FTCBV-7">[7]</a><a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-CNMVEHF-8">[8]</a><a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-VBOHF-9">[9]</a><a href="https://en.wikipedia.org/wiki/Ethereum#cite_note-CSHFS-10">[10]</a></p>', '2017-06-05 18:47:09', '2017-06-07 14:03:08', 3, 'ethereum_1496851388.jpg'),
