(31, 'Linux', '<p><strong>Linux</strong>&nbsp;(pronounced&nbsp;<a href="https://upload.wikimedia.org/wikipedia/commons/0/03/Linus-linux.ogg"><img alt="Listen" src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Speakerlink-new.svg/11px-Speakerlink-new.svg.png" style="height:11px; width:11px" /></a><a href="https://en.wikipedia.org/wiki/File:Linus-linux.ogg">i</a><a href="https://en.wikipedia.org/wiki/Help:IPA_for_English">/ˈlɪnəks/</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Help:Pronunciation_respelling_key"><small><em><strong>LIN</strong>-əks</em></small></a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-pronunciation-2-11">[9]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-Foldoc09Jun06-12">[10]</a>&nbsp;or, less frequently,&nbsp;<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English">/ˈlaɪnəks/</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Help:Pronunciation_respelling_key"><small><em><strong>LYN</strong>-əks</em></small></a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-Foldoc09Jun06-12">[10]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-pronunciation-1-13">[11]</a>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Unix-like">Unix-like</a>&nbsp;computer&nbsp;<a href="https://en.wikipedia.org/wiki/Operating_system">operating system</a>&nbsp;assembled under the model of&nbsp;<a href="https://en.wikipedia.org/wiki/Free_and_open-source_software">free and open-source software</a>&nbsp;development and distribution. The defining component of Linux is the&nbsp;<a href="https://en.wikipedia.org/wiki/Linux_kernel">Linux kernel</a>,<a href="https://en.wikipedia.org/wiki/Linux#cite_note-14">[12]</a>&nbsp;an&nbsp;<a href="https://en.wikipedia.org/wiki/Kernel_(computing)">operating system kernel</a>&nbsp;first released on September 17, 1991 by&nbsp;<a href="https://en.wikipedia.org/wiki/Linus_Torvalds">Linus Torvalds</a>.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-15">[13]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-16">[14]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-17">[15]</a>&nbsp;The&nbsp;<a href="https://en.wikipedia.org/wiki/Free_Software_Foundation">Free Software Foundation</a>&nbsp;uses the name&nbsp;<em><a href="https://en.wikipedia.org/wiki/GNU">GNU</a>/Linux</em>&nbsp;to describe the operating system, which has led to some&nbsp;<a href="https://en.wikipedia.org/wiki/GNU/Linux_naming_controversy">controversy</a>.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-gnu_linux_faq-18">[16]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-linux-and-gnu-19">[17]</a></p>\r\n\r\n<p>Linux was originally developed for&nbsp;<a href="https://en.wikipedia.org/wiki/Personal_computer">personal computers</a>&nbsp;based on the&nbsp;<a href="https://en.wikipedia.org/wiki/Intel_x86">Intel x86</a>&nbsp;architecture, but has since been&nbsp;<a href="https://en.wikipedia.org/wiki/Porting">ported</a>&nbsp;to more&nbsp;<a href="https://en.wikipedia.org/wiki/Computer_hardware_platforms">platforms</a>&nbsp;than any other operating system.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-20">[18]</a>&nbsp;Because of the dominance of&nbsp;<a href="https://en.wikipedia.org/wiki/Android_(operating_system)">Android</a>&nbsp;on&nbsp;<a href="https://en.wikipedia.org/wiki/Smartphone">smartphones</a>, Linux has the&nbsp;<a href="https://en.wikipedia.org/wiki/Usage_share_of_operating_systems">largest</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Installed_base">installed base</a>&nbsp;of all&nbsp;<a href="https://en.wikipedia.org/wiki/General-purpose_operating_system">general-purpose operating systems</a>.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-marketshare.hitslink.com-21">[19]</a>&nbsp;Linux is also the leading operating system on&nbsp;<a href="https://en.wikipedia.org/wiki/Server_(computing)">servers</a>&nbsp;and other&nbsp;<a href="https://en.wikipedia.org/wiki/Big_iron">big iron</a>&nbsp;systems such as&nbsp;<a href="https://en.wikipedia.org/wiki/Mainframe_computer">mainframe computers</a>, and is used on 99.6% of the&nbsp;<a href="https://en.wikipedia.org/wiki/TOP500">TOP500</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Supercomputer">supercomputers</a>.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-22">[20]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-rules_supercomputers-23">[21]</a>&nbsp;It is used by around 2.3% of&nbsp;<a href="https://en.wikipedia.org/wiki/Desktop_computer">desktop computers</a>.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-Netmarketshare.com-24">[22]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-25">[23]</a>&nbsp;The&nbsp;<a href="https://en.wikipedia.org/wiki/Chromebook">Chromebook</a>, which runs the Linux kernel-based&nbsp;<a href="https://en.wikipedia.org/wiki/Chrome_OS">Chrome&nbsp;OS</a>, dominates the US&nbsp;<a href="https://en.wikipedia.org/wiki/K%E2%80%9312">K&ndash;12</a>&nbsp;education market and represents nearly 20% of the sub-$300&nbsp;<a href="https://en.wikipedia.org/wiki/Notebook">notebook</a>&nbsp;sales in the US.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-26">[24]</a>&nbsp;Linux also runs on&nbsp;<a href="https://en.wikipedia.org/wiki/Embedded_system">embedded systems</a>&nbsp;&ndash; devices whose&nbsp;<a href="https://en.wikipedia.org/wiki/Operating_system">operating system</a>&nbsp;is typically built into the&nbsp;<a href="https://en.wikipedia.org/wiki/Firmware">firmware</a>&nbsp;and is highly tailored to the system. This includes&nbsp;<a href="https://en.wikipedia.org/wiki/TiVo">TiVo</a>&nbsp;and similar&nbsp;<a href="https://en.wikipedia.org/wiki/Digital_video_recorder">DVR</a>&nbsp;devices, network&nbsp;<a href="https://en.wikipedia.org/wiki/Router_(computing)">routers</a>, facility automation controls, televisions,<a href="https://en.wikipedia.org/wiki/Linux#cite_note-27">[25]</a><a href="https://en.wikipedia.org/wiki/Linux#cite_note-28">[26]</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Video_game_console">video game consoles</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Smartwatch">smartwatches</a>.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-LinuxDevices-29">[27]</a>&nbsp;Many smartphones and&nbsp;<a href="https://en.wikipedia.org/wiki/Tablet_computer">tablet computers</a>&nbsp;run Android and other Linux derivatives.<a href="https://en.wikipedia.org/wiki/Linux#cite_note-30">[28]</a></p>', '2017-06-06 10:06:46', '2017-06-07 13:50:43', 2, 'linux_1496850643.jpg'),
(32, 'Angular', '<p><strong>AngularJS</strong>&nbsp;(commonly referred to as &quot;<strong>Angular.js</strong>&quot; or &quot;<strong>AngularJS 1.X</strong>&quot;) is a JavaScript-based&nbsp;<a href="https://en.wikipedia.org/wiki/Open-source_software">open-source</a>&nbsp;front-end&nbsp;<a href="https://en.wikipedia.org/wiki/Web_application_framework">web application framework</a>&nbsp;mainly maintained by&nbsp;<a href="https://en.wikipedia.org/wiki/Google">Google</a>&nbsp;and by a community of individuals and corporations to address many of the challenges encountered in developing&nbsp;<a href="https://en.wikipedia.org/wiki/Single-page_application">single-page applications</a>. The JavaScript components complement&nbsp;<a href="https://en.wikipedia.org/wiki/Apache_Cordova">Apache Cordova</a>, the framework used for developing cross-platform mobile apps. It aims to simplify both the development and the&nbsp;<a href="https://en.wikipedia.org/wiki/Software_testing">testing</a>&nbsp;of such applications by providing a framework for client-side&nbsp;<a href="https://en.wikipedia.org/wiki/Model%E2%80%93view%E2%80%93controller">model&ndash;view&ndash;controller</a>&nbsp;(MVC) and&nbsp;<a href="https://en.wikipedia.org/wiki/Model_View_ViewModel">model&ndash;view&ndash;viewmodel</a>&nbsp;(MVVM) architectures, along with components commonly used in&nbsp;<a href="https://en.wikipedia.org/wiki/Rich_Internet_application">rich Internet applications</a>. In 2014, the original AngularJS team began working on&nbsp;<a href="https://en.wikipedia.org/wiki/Angular_(Application_Platform)">Angular (Application Platform)</a>.</p>\r\n\r\n<p>The AngularJS framework works by first reading the&nbsp;<a href="https://en.wikipedia.org/wiki/HTML">HTML</a>&nbsp;page, which has embedded into it additional custom&nbsp;<a href="https://en.wikipedia.org/wiki/HTML_attribute">tag attributes</a>. Angular interprets those attributes as&nbsp;<a href="https://en.wikipedia.org/wiki/Directive_(programming)">directives</a>&nbsp;to bind input or output parts of the page to a model that is represented by standard&nbsp;<a href="https://en.wikipedia.org/wiki/JavaScript">JavaScript</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Variable_(computer_science)">variables</a>. The values of those JavaScript variables can be manually set within the code, or retrieved from static or dynamic&nbsp;<a href="https://en.wikipedia.org/wiki/JSON">JSON</a>&nbsp;resources.</p>\r\n\r\n<p>According to&nbsp;<a href="https://en.wikipedia.org/wiki/JavaScript">JavaScript</a>&nbsp;analytics service&nbsp;<a href="https://en.wikipedia.org/wiki/Libscore">Libscore</a>, AngularJS is used on the websites of&nbsp;<a href="https://en.wikipedia.org/wiki/Wolfram_Alpha">Wolfram Alpha</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/NBC">NBC</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Walgreens">Walgreens</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Intel">Intel</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Sprint_Nextel">Sprint</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/ABC_News">ABC News</a>, and approximately 12,000 other sites out of 1 million tested in October 2016.<a href="https://en.wikipedia.org/wiki/AngularJS#cite_note-3">[3]</a>&nbsp;AngularJS is the 6th most starred project of all time on GitHub.<a href="https://en.wikipedia.org/wiki/AngularJS#cite_note-4">[4]</a></p>\r\n\r\n<p>AngularJS is the frontend part of the&nbsp;<a href="https://en.wikipedia.org/wiki/MEAN_(software_bundle)">MEAN stack</a>, consisting of&nbsp;<a href="https://en.wikipedia.org/wiki/MongoDB"><strong>M</strong>ongoDB</a>&nbsp;database,&nbsp;<a href="https://en.wikipedia.org/wiki/Express.js"><strong>E</strong>xpress.js</a>&nbsp;web application server framework,&nbsp;<strong>A</strong>ngular.js itself, and&nbsp;<a href="https://en.wikipedia.org/wiki/Node.js"><strong>N</strong>ode.js</a>&nbsp;server runtime environment.</p>', '2017-06-06 10:09:02', '2017-06-07 13:49:16', 2, 'angular_1496850556.png'),
(33, 'Vue javascript framework', '<p>Vue (pronounced /vjuː/, like&nbsp;<strong>view</strong>) is a&nbsp;<strong>progressive framework</strong>&nbsp;for building user interfaces. Unlike other monolithic frameworks, Vue is designed from the ground up to be incrementally adoptable. The core library is focused on the view layer only, and is very easy to pick up and integrate with other libraries or existing projects. On the other hand, Vue is also perfectly capable of powering sophisticated Single-Page Applications when used in combination with&nbsp;<a href="https://vuejs.org/v2/guide/single-file-components.html">modern tooling</a>&nbsp;and&nbsp;<a href="https://github.com/vuejs/awesome-vue#components--libraries" target="_blank">supporting libraries</a>.</p>\r\n\r\n<p>If you are an experienced frontend developer and want to know how Vue compares to other libraries/frameworks, check out the&nbsp;<a href="https://vuejs.org/v2/guide/comparison.html">Comparison with Other Frameworks</a>.</p>', '2017-06-06 10:10:32', '2017-06-07 13:45:23', 1, 'slika2_1496850323.jpg'),
(35, 'Node javascript', '<p><strong>Node.js</strong>&nbsp;is an&nbsp;<a href="https://en.wikipedia.org/wiki/Open-source_software">open-source</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Cross-platform">cross-platform</a>&nbsp;<a href="https://en.wikipedia.org/wiki/JavaScript">JavaScript</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Runtime_system">run-time environment</a>&nbsp;for executing JavaScript code&nbsp;<a href="https://en.wikipedia.org/wiki/Server-side">server-side</a>. Historically, JavaScript was used primarily for&nbsp;<a href="https://en.wikipedia.org/wiki/Client-side_scripting">client-side scripting</a>, in which scripts written in JavaScript are embedded in a webpage&#39;s HTML, to be run client-side by a JavaScript engine in the user&#39;s web browser. Node.js enables JavaScript to be used for&nbsp;<a href="https://en.wikipedia.org/wiki/Server-side_scripting">server-side scripting</a>, and runs scripts server-side to produce&nbsp;<a href="https://en.wikipedia.org/wiki/Dynamic_web_page">dynamic web page</a>&nbsp;content&nbsp;<em>before</em>&nbsp;the page is sent to the user&#39;s web browser. Consequently, Node.js has become one of the foundational elements of the &quot;JavaScript everywhere&quot; paradigm,<a href="https://en.wikipedia.org/wiki/Node.js#cite_note-4">[4]</a>&nbsp;allowing&nbsp;<a href="https://en.wikipedia.org/wiki/Web_application">web application</a>&nbsp;development to unify around a single programming language, rather than rely on a different language for writing server side scripts.</p>\r\n\r\n<p>Though&nbsp;<code>.js</code>&nbsp;is the conventional&nbsp;<a href="https://en.wikipedia.org/wiki/Filename_extension">filename extension</a>&nbsp;for JavaScript code, the name &quot;Node.js&quot; does not refer to a particular file in this context and is merely the name of the product. Node.js has an&nbsp;<a href="https://en.wikipedia.org/wiki/Event-driven_architecture">event-driven architecture</a>&nbsp;capable of&nbsp;<a href="https://en.wikipedia.org/wiki/Asynchronous_I/O">asynchronous I/O</a>. These design choices aim to optimize&nbsp;<a href="https://en.wikipedia.org/wiki/Throughput">throughput</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Scalability">scalability</a>&nbsp;in&nbsp;<a href="https://en.wikipedia.org/wiki/Web_application">Web applications</a>&nbsp;with many input/output operations, as well as for&nbsp;<a href="https://en.wikipedia.org/wiki/Real-time_Web">real-time Web</a>&nbsp;applications (e.g.,&nbsp;<a href="https://en.wikipedia.org/wiki/Real-time_communication">real-time communication</a>&nbsp;programs and&nbsp;<a href="https://en.wikipedia.org/wiki/Browser_game">browser games</a>).<a href="https://en.wikipedia.org/wiki/Node.js#cite_note-readwrite-5">[5]</a></p>\r\n\r\n<p>The Node.js&nbsp;<a href="https://en.wikipedia.org/wiki/Distributed_development">distributed development</a>&nbsp;project, governed by the Node.js Foundation,<a href="https://en.wikipedia.org/wiki/Node.js#cite_note-6">[6]</a>&nbsp;is facilitated by the&nbsp;<a href="https://en.wikipedia.org/wiki/Linux_Foundation">Linux Foundation</a>&#39;s Collaborative Projects program.<a href="https://en.wikipedia.org/wiki/Node.js#cite_note-7">[7]</a></p>', '2017-06-06 15:18:14', '2017-06-07 13:42:41', 1, 'slika4_1496850161.jpg'),
(36, 'Web development', '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '2017-06-07 13:16:11', '2017-06-07 13:40:13', 1, 'slika1_1496850013.jpg');

